import React, { useState } from "react";
import { Button, Modal, ModalHeader, ModalBody, Media } from "reactstrap";
const cynTarjetasModal = (props) => {
  const [modal, setModal] = useState(false);
  const toggle = () => setModal(!modal);

  return (
    <div>
      <Button color="danger" onClick={toggle} color="link">
        <span role="img">ℹ️</span>
      </Button>
      <Modal isOpen={modal} toggle={toggle}>
        <ModalHeader toggle={toggle}>Color y Numero Tarjetas</ModalHeader>
        <ModalBody>
          <h1>Test</h1>
        </ModalBody>
      </Modal>
    </div>
  );
};

export default cynTarjetasModal;
